★シナノのウォーキングポール！<br>
<br>
●持ち運びに便利な３段伸縮式ウォーキングポール！<br>
●ストラップの内側はメッシュ素材になっており、通気性がよく発汗時のムレを防ぎます。<br> 
●ポール先端の先ゴムは半球形状で、360度どの角度からでもしっかりと接地できます。<br>
●ＳＧマーク(製品安全協会認定安全基準合格品)取得製品。<br>
<br>
■重量：約245ｇ／１本<br>
■素材 アルミ合金<br>
■企画製造販売元 株式会社シナノ<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■全長：95～120cm<br>
■収納長：56cm<br>
■対応身長：150cm～190cm<br>
<br>
<p><img src="http://image.rakuten.co.jp/outlet-grasshopper/cabinet/evidence/04474471/116303-evidence.jpg"></p>
