★ノースフェイスのトレッキングゲイター！<br>
<br>
●トレッキング中に雨水や汚れから足元を守る、防水透湿素材を使用したゲイター。<br>
●雪や雨などをシャットアウトし、ウェア内の水蒸気を排出してムレを防ぎます。<br>
●靴底の柔らかいトレッキングシューズでも足裏に干渉しない、フラットな樹脂製ストラップを使用。<br>
●専用のスタッフサック付属。<br>
※画像は装着時のイメージで、商品はゲイターのみとなります。<br>
<br>
■素材<br>
表：ナイロン100％(コーティング等樹脂加工)<br>
裏：ナイロン100％<br>
