つながる安心！1台で、3つの機能、ラジオ、ライト、携帯充電、ライフライン複合機！<br>
総重量：（約）260g<br>
サイズ：（約）幅13×奥行4.5×高さ7.3cm<br>
光源：LED<br>
明るさ：［LED球値］16ルーメン<br>
　　　　［ロゴス基準値］16ルーメン<br>
電源：クランクチャージ、ソーラー、USB<br>
外部充電可能対象：携帯電話、iPhone、スマートフォン<br>
目安使用時間：［ライト点灯時間］満蓄電→約5時間点灯・3分クランク蓄電→約30分点灯<br>
　　　　　　　　　　　　　　　　ソーラー3時間畜電（晴天）→約3時間点灯<br>
　　　　　　　［ラジオ］3分クランク蓄電→約1時間使用・ソーラー3時間畜電（晴天）→約5時間使用<br>
　　　　　　　［携帯電話充電］満畜電→約100％充電・10分クランク蓄電→約5分使用<br>
　　　　　　　　　　　　　　　ソーラー5時間畜電（晴天）→約20分使用<br>
　　　　　　　［iPhone・スマホ充電］満畜電→約60％充電・ソーラー5時間畜電（晴天）→約10％充電<br>
※くもりでのソーラー充電は、晴天時の約1/6もしくはそれ以下とお考えください<br>
USB蓄電時間：約6時間で満蓄電<br>
内蔵機能：ライト、ラジオ（AM.FM）、ソーラー充電、クランク充電、USB充電<br>
ソーラーパネル能力：0.15W（5V 30mA）<br>
内蔵電池：リチウムポリマー電池<br>
内蔵電池容量：1500mAh<br>
主素材：ABS<br>
<br>
●緊急時に役立つ充電機能付きラジオライト<br>
●iPhoneやスマートフォン等の携帯電話に充電ができます<br>
