トップクラスの超軽量登山用ヘルメット。EPP(ビーズ法発泡ポリプロピレン)シェルと最小限の調節システムを採用することで、軽量化を図りました。EPPプラスチックの高いクッション性に加え、安全性を最大限に高めるため、ヘルメットシェルには丈夫なハードシェルを使用。難所においても頭部の快適さとクリアな思考をキープするため、多数の通気口が随所に設けられています。フィット感に優れているだけでなく、頭の形に合わせて調節可能なシステムを採用しているため、ぴったり装着できます。また、ヘッドランプをヘルメットに固定するためのクリップ2点と伸縮性ストラップも付いています。<br>
<br>製品 Nr: 2220-00140<br>
<br>特徴/特性<br>
  ・部分ハードシェルと組み合わせたEPPコア<br>
  ・人間工学に基づいた、快適なパッド入りの内部<br>
  ・空気を循環させ、熱を放出する大きなベンチレーション<br>
  ・超軽量、最小限の調節システム<br>
  ・最高にフィットする、万能で、完璧に調整可能なあごストラップ<br>
  ・フロントにクリップ2つ、反対側にヘッドランプ固定用のゴムループ1つ<br>
  ・EN 12492規格<br>
